import React from 'react';
import { BrowserRouter as Router } from 'react-router-dom'; 
import AppState from './context/appState';
import Bar from './components/navbar';

function App() {
  return (
  	<AppState>
	    <Router>
	      	<Bar />
	    </Router>
    </AppState>
  );
}

export default App;
